import { Nav } from 'react-bootstrap'
import './index.css'

function Navb() {
    return (
        <nav class="navbar navbar-light bg-light">
            <div class="container-fluid">
                <a class="navbar-brand" href="#">Login</a>
            </div>
        </nav>
    )
}

export default Navb
